import React, { Component } from 'react';
import './App.css';
import FooterForm from './footer/footer';
import HeaderForm from './header/header';
import {BrowserRouter, Route} from 'react-router-dom'
import HomeForm from './main/main';
import AboutForm from './main/about';
import ResumeForm from './main/resume';
import ContactForm from './main/contact';

class App extends Component {


  render(){
  return (
    <BrowserRouter>

    <div className="App">


   <HeaderForm />
   <Route exact path="/home" component= {HomeForm} />
   <Route exact path="/about" component= {AboutForm} />
   <Route exact path="/resume" component= {ResumeForm} />
   <Route exact path="/contact" component= {ContactForm} />

 <img src="/images/hero.jpg" ></img>


<FooterForm />

</div>

    </BrowserRouter>


    );
}}

export default App;
